import React from 'react';

import {BookstoreConsumer} from '../bookstore-context';

const withBookstoreService = () => (Wrapped) => {
    return (props) => {
        return (
            <BookstoreConsumer>
                {
                    (bookstoreService) => {
                        return <Wrapped {...props} 
                                    bookstoreService={bookstoreService} />
                    }
                }
            </BookstoreConsumer>
        );
    }
}
export default withBookstoreService;
